import React, { Fragment, useEffect, useState } from "react";







//View Capacity function

const ViewSummary = () => {

    const [summary, SetSummary] = useState([]);

    const getSummary = async () => {
        try {
            const response = await fetch("http://localhost:5000/api/Summary");
            const jsonData = await response.json();
            
            SetSummary(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getSummary();
    } , []);
    

    return (
        <Fragment>
            <div style={{ backgroundColor: '#BED3AB', padding: '40px', borderRadius: '30px', margin: '60px' }}>
                <table class="table table-hover table-responsive-md table align-middle table caption-top">
                <caption><h2>Summary of Pending Requests</h2></caption>
            <thead>
                <tr>
                    <th>Number of Pending requests</th>
                    <th>Priority</th>
                    <th>Support Team Required</th>
                </tr>
            </thead>
            <tbody>
                {summary.map((item) => (
                    <tr>
                        <td>{item.pending}</td>
                        <td>{item.priority}</td>
                        <td>{item.support_team_required}</td>
                    </tr>
                ))}
            </tbody>
            </table>
            </div>
        </Fragment>
    )
};

export default ViewSummary;
